import React, { Component } from 'react'
import MediaPlayer from '../MediaPlayer/Media-Player'


class Results extends Component {
    constructor() {
        super();
        this.state = {
            interval: '',
            waiting4DB: true,
        }
    }


    componentDidMount() {
        this.setState({ interval: setInterval(this.listen4DB, 1000) })
    }

    listen4DB = () => {
        if (this.props.addresses) {
            this.setState({ waiting4DB: false })
            this.stopListening4DB()
        }
    }

    stopListening4DB = () => {
        clearInterval(this.state.interval);
    }

    handleClick = (args) => {
        console.log(args)
    }

    render() {



        return (
            <div className="Results">
                Results
                {this.props.response && <div>
                    <MediaPlayer
                        videoId={this.props.response.items[5].id.videoId}
                    />
                </div>}

            </div>
        )
    }

}

export default Results
